window.bookSummaryJSON = "<p>Jonathan Slate, former Marine infantry officer and the Governor of Texas, has just won his bid for the presidency. When an assassin's bullet takes his life during his victory speech, he is conscripted from the afterlife by the Lord of Light, Lucidus.</p> <p>Slate is thrust into the game-like world of Somnium where he has been reincarnated into the body of a parasite and given one mission: evolve or die.</p> <p>If he can channel the monster inside and utilize his military and political experience to establish Lucidus' personal army, the Scourge, he might have a chance to evolve before his many enemies find him and send him to a permanent death.</p>"; 
